import React from 'react';

import Aux from '../../../hoc/Aux';
import Column from './Column/Column';

import './Columns.css';

const Columns = (props) => (
    <Aux>
        <Column>
            <h2>Our product</h2>
            <ul>
                <li>Overview</li>
                <li>Features</li>
                <li>Pricing</li>
                <li>How it works</li>
                <li>Why Typethread</li>
                <li>FAQ</li>
            </ul>
        </Column>
    </Aux>
);

export default Columns;
